pragma solidity 0.8.16;

contract ALLPrimeNumber{
    uint[] arrayPrime;

    function addPrime(uint nbr) public returns (bool){
        if(nbr == 1)
        return false;

        for(uint i = 2; i < nbr; i++){
            if(i % nbr == 0){
                return false;
            }
        }
        arrayPrime.push(nbr);
        return true;
    }

